      fetch(url,{
          method:"POST",
          headers:{
              "Content-Type":"application/json",
              Accept:"application/json",
  
            },
            body:JSON.stringify({name:name}),

        });

    };

    

  return (
    <div>
         <p>
            <input type='text' onChange={(e) =>setId(e.target.value)}></input>
          </p>
          <p>
            <button type='button'>Submit</button>
          </p>
        

    </div>
  )
}
